[TestClass]
public class UnitTestVowelsProblem
{
  [TestMethod]
  public void TestMethodVowelsProblem4Test()
  {
    TestVowelsProblem vp = new();

    var res = vp.MaxVowels("abciiidef", 3);
    Assert.AreEqual(3, res);

    res = vp.MaxVowels("aeiou", 2);
    Assert.AreEqual(2, res);

    res = vp.MaxVowels("leetcode", 3);
    Assert.AreEqual(2, res);

    res = vp.MaxVowels("weallloveyou", 7);
    Assert.AreEqual(4, res);
  }

